el club del supp busca nuevos integrantes
El Tereso (LATS) enviado about 2 hours ago en Charlas Generales
hola, soy el creador del club del supp, y el motivo de este club es crear un lugar donde todos tipos de personas (que obviamente maineen el roll de supp) puedan estar en contacto y en constante aprendizaje... no hay requisitos para entrar solo ser main de algun o varios supp, les aviso de antemano q soy un bronza... de echo soy bronze 3 y no hay muchos elos altos en el club de momento por q bueno ya se daran una idea q no se... parece q no les gusta estar con gente de elo bajo...
Bueno en fin, cabe recalcar q no somos exigentes en respecto a tu liga... puedes ser challenger o unranked no importa si quieres puedes entrar... desde ya muchas gracias y bueno los esperamos {{sticker:slayer-pantheon-thumbs}} 
interesados mandarme solicitud nick: El Tereso
pd: avisenme al momento q los acepte q es por el club... generalmente tengo tanto el lol como los foros abiertos asi q te estaria agregando al grupo el mismo dia q me mandes la solicitud... ahora si chau {{sticker:slayer-jinx-wink}}

